import React, { memo } from "react";
import { Drawer as DrawerMaterial } from "@mui/material";

//Styles
import { Container, NavLinkStyled } from "./styles";

declare interface DrawerProps {
  open: boolean;
}

const Drawer = ({ open }: DrawerProps) => {
  return (
    <DrawerMaterial open={open}>
      <Container>
        <NavLinkStyled to="/">
          <span>{"Users"}</span>
        </NavLinkStyled>
        <NavLinkStyled to="repositories">
          <span>{"Repositories"}</span>
        </NavLinkStyled>
      </Container>
    </DrawerMaterial>
  );
};

export default memo(Drawer);
